from django.shortcuts import render
from django.http.request import HttpRequest
from django.http.response import HttpResponse
import random as rd


def index(request: HttpRequest) -> HttpResponse:
    html_code: str = "<h1 style='color: red'> HELLO </h1>"
    response: HttpResponse = HttpResponse(html_code)
    return response

def random(request: HttpRequest) -> HttpResponse:
    html_code: str = f"<h1 style='color: red'>HELLO</h1>"
    response: HttpResponse = HttpResponse(html_code)
    return response

def roundd(request: HttpRequest) -> HttpResponse:
    template_name: str = 'index.html'
    return render(
        request=request,
        template_name=template_name,
        context={}
    )

